import Data from '../data/data.json';
import Navbar from './Navbar';
import Product from './Product';

function App() {
  const renderedItems = Data.map(item => {

    const imageUrl = import(`../images/products/${item.imageFile}`).then(image => {
      return(
        <Product 
          key={item.id}
          imgUrl={imageUrl}
          name={item.name}
          description={item.description}
          price={item.price}
          discount={50}
        />
      )
    })


  })
  return(
    <div>
      <Navbar />
      {renderedItems}
    </div>
  )
}

export default App;
